define('src/views/Home',['underscore', 'backbone', 'src/App'], function(_, Backbone, App) {
    

    var Home = Backbone.View.extend({

        tagName: "div",

        className: "view",

        initialize: function(options) {
            this.template = options.template;
            this.listenTo(this.model, 'change', this.render);
            App.start();
        },

        events: {
            "click #homeImage": "onImageClicked",
            "click #btnHomeExtras": "onExtrasClicked"
        },

        onImageClicked: function() {
            var site = this.model.get('site');
            var operation = this.getOperation(site);
            switch (operation) {
                case App.operationTypes.ERROR:
                    break;
                case App.operationTypes.UNADDRESSED:
                    App.stop();
                    App.pageRouter.navigate('placement', {trigger: true, replace: true});
                    break;
                case App.operationTypes.PLACED || App.operationTypes.MIDSEASON:
                    alert("Inspections are not implemented");
                    break;
                case App.operationTypes.FINAL:
                    break;
                case App.operationTypes.OMITTED:
                    break;
            }
        },

        onExtrasClicked: function() {
            App.stop();
            App.pageRouter.navigate('extras', {trigger: true, replace: true});
        },

        render: function() {
            this.$el.html(this.template(this.model.toJSON()));
            this.checkTargetCircle(null);
            return this;
        },

        checkTargetCircle: function () {
            var relativePosition = this.model.get('relativePosition');
            var isOut = relativePosition.DistanceOutside > 0;
            var site = this.model.get('site');

            var color = this.getColor(isOut);
            var imageSource = this.getOperationImage(isOut, site);

            this.$el.find('#siteDiv').css('background-color', color);
            this.$el.find('#homeImage').attr('src', imageSource);
        },

        getColor: function(isOut) {
            return isOut ? '#FF0000' : '#799839';
        },

        getOperationImage: function(isOut, site) {
            var imagePath = 'img/';
            imagePath += isOut ? 'red' : 'green';
            imagePath += this.getImageType(site);
            imagePath += '.gif';
            return imagePath;
        },

        getImageType: function(site) {
            var imagePath = '';
            if (typeof site.xact === 'undefined') {
                imagePath = 'Tree';
            } else if (typeof site.visit === 'undefined') {
                site.trap_type;
                imagePath = site.trap_type === 'Delta' ? 'Delta' : 'MilkCarton';
            }
            return imagePath;
        },

        getOperation: function(site) {
            var operationType = '';
            if (site.quad === '') {
                operationType = App.operationTypes.ERROR;
            } else if (typeof site.xact === 'undefined') {
                operationType = App.operationTypes.UNADDRESSED;
            } else if (typeof site.visit === 'undefined') {
                if (typeof site.omit_reason === 'undefined') {
                    operationType = App.operationTypes.PLACED;
                } else {
                    operationType = App.operationTypes.OMITTED;
                }
            } else if (site.visit === 'MIDSEASON') {
                operationType = App.operationTypes.MIDSEASON;
            } else {
                operationType = App.operationTypes.FINAL;
            }
            return operationType;
        }
    });

    return Home;
});

define ('src/util/DB',['jquery'], function ($) { 'use strict'
    var my = {};

    var PERSISTENT;

    my.root = '';
    my.filesystem = '';
    my.sitesFile = 'TX_1.json';
    my.activityLog = "trans_log.txt";

    my.initialize = function() {
        return getFileSystem().done(getRootDirectory());
    };

    var getFileSystem = function() {
        var deferred = new $.Deferred();
        checkIfFileSystemIsDefined();

        var grantedBytes = 0;
        window.requestFileSystem  = window.requestFileSystem || window.webkitRequestFileSystem;
        //window.webkitStorageInfo.requestQuota(PERSISTENT, 1024*1024, function(grantedBytes) {
        window.requestFileSystem(PERSISTENT, grantedBytes, function(fileSystem) {
                my.filesystem = fileSystem;
                deferred.resolve();
            }, my.fail);
        //});
        return deferred.promise();
    };

    var checkIfFileSystemIsDefined = function() {
        if (typeof LocalFileSystem === 'undefined') {
            PERSISTENT = window.PERSISTENT;
        } else {
            PERSISTENT = LocalFileSystem.PERSISTENT ;
        }
    };

    var getRootDirectory = function() {
        var deferred = new $.Deferred();
        my.filesystem.root.getDirectory("G3", {create: true, exclusive: false }, function(dirEntry) {
            my.root = dirEntry;
            deferred.resolve();
        }, my.fail);
        return deferred.promise();
    };

    my.countFiles = function() {
        var deferred = new $.Deferred();
        var directoryReader = my.root.createReader();
        var fileCount = directoryReader.readEntries(function(entries) {
           my.fileCount = entries.length;
           deferred.resolve();
        }, my.fail);
        return deferred.promise();
    };

    my.loadSites = function(state, bidunit) {
        var deferred = new $.Deferred();
        getFileEntry(my.root, makeFilename(state, bidunit), {create: false}).then(getFile).then(loadFile).then(function(data) {
            deferred.resolve(data);
        });
        return deferred.promise();
    };

    var makeFilename = function(state, bidunit) {
        return state + "_" + bidunit + ".json";
    };

    var getFileEntry = function(dirEntry, filename, params) {
        var deferred = new $.Deferred();
        dirEntry.getFile(filename, params,
        function gotFileEntry(fileEntry) {
            deferred.resolve(fileEntry);
        });
        return deferred.promise();
    };

    var getFile = function(fileEntry) {
        var deferred = new $.Deferred();
        fileEntry.file( function success(file) {
            deferred.resolve(file);
        }, my.fail);
        return deferred.promise();
    };

    var loadFile = function(file) {
        var deferred = new $.Deferred();
        var reader = new FileReader();
        reader.onloadend = function(evt) {
            deferred.resolve(JSON.parse(evt.target.result));
        };
        reader.readAsText(file);
        return deferred.promise();
    };

    my.downloadSites = function (state, bidunit){
        var deferred = new $.Deferred();
        var fileTransfer = new FileTransfer();
        var uri = encodeURI("http://yt.ento.vt.edu/SlowTheSpread/gadgetsites/" + state + "/" + bidunit + "?format=json");
        var filename = my.root.fullPath + '/' + makeFilename(state, bidunit);

        fileTransfer.download(
            uri,
            filename,
            function(entry) {
                console.log("G3 file downloaded; filename = " + filename + "; fileentry = " + entry.fullPath);
                getFile(entry).then(loadFile).then(function() {
                    deferred.resolve();
                });
            },
            function(error) {
                if (error.code === 3) {
                    alert("No network connection");
                } else {
                    console.log(error.code);
                }
                deferred.reject();
            }
        );
        return deferred.promise();
    };

    my.saveSites = function(sitesList) {
        var deferred = new $.Deferred();
        var data = JSON.stringify(sitesList);
        getFileEntry(my.root, my.sitesFile, {create: true, exclusive: false}).then(function(fileEntry) {
            writeFile(fileEntry, data).then( function() {
                deferred.resolve();
            });
        });
        return deferred.promise();
    };

    var writeFile = function(fileEntry, data) {
        var deferred = new $.Deferred;
        fileEntry.createWriter(function(writer) {
            writer.onwriteend = function(evt) {
                deferred.resolve();
            };
            writer.write(data);
        }, my.fail);
        return deferred.promise();
    };

    my.logOperation = function(data) {
        var deferred = new $.Deferred;
        getFileEntry(my.root, my.activityLog, {create: true, exclusive: false}).then(function(fileEntry) {
            appendFile(fileEntry, data).then( function() {
                deferred.resolve();
            });
        });
        return deferred.promise();
    };

    var appendFile = function(fileEntry, data) {
        var deferred = new $.Deferred;
        fileEntry.createWriter(function(writer) {
            writer.onwriteend = function(evt) {
                deferred.resolve();
            };
            writer.seek(writer.length);
            writer.write(data);
        }, my.fail);
        return deferred.promise();
    };

    my.fail = function(error) {
        throw error;
    };

    return my;
});
